自定义 LineMarker 的方式有两种： 通过 LineMarkerProvider 实现 通过 RunLineMarkerContributor 实现 <!-- line marker -->
<codeInsight.lineMarkerProvider language="Feakin" implementationClass="com.feakin.intellij.linemarkers.FkImplMessageProvider"/> <!-- producer -->
<runConfigurationProducer implementation="com.feakin.intellij.runconfig.command.FkEndpointConfigurationProducer"/> 在 Intellij Feakin 中，先创建 RunLineMarkerContributor 后，再创建 RunConfigurationProducer，如 GencodeImplConfigurationProducer。 class FkCodegenImplLineMarkerContributor : RunLineMarkerContributor() { override fun getInfo(element: PsiElement): Info? { if (element !is FkImplDeclaration) return null val state = GencodeImplConfigurationProducer().findConfig(listOf(element)) ?: return null val actions = ExecutorAction.getActions(0) return Info( AllIcons.RunConfigurations.TestState.Run, { state.configurationName }, *actions ) }
} 示例： class GencodeImplConfigurationProducer : BaseLazyRunConfigurationProducer<GencodeConfig, FkImplDeclaration>() { override val commandName: String = "gen" init { registerConfigProvider { elements -> createConfigFor<FkImplDeclaration>(elements) } } private inline fun <reified T : FkImplDeclaration> createConfigFor( elements: List<PsiElement> ): GencodeConfig? { val path = elements.firstOrNull()?.containingFile?.virtualFile?.path ?: return null val sourceElement = elements.firstOrNull { it is T } ?: return null return GencodeConfig(commandName, path, sourceElement as FkImplDeclaration) } private fun registerConfigProvider(provider: (List<PsiElement>) -> GencodeConfig?) { runConfigProviders.add(provider) }
}
